DROP TABLE IF EXISTS `solicitud`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `solicitud` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `idItemServicio` int(11) NOT NULL,
  `idSeguro` int(11) NOT NULL,
  `idUsuarioSol` int(11) NOT NULL,
  `idPaciente` int(11) NOT NULL,
  `codigoSol` varchar(30) NOT NULL,
  `fecha` date NOT NULL,
  `diagnostico` varchar(400) NOT NULL,
  `horaSol` time NOT NULL,
  `resultadoRecibido` tinyint(1) DEFAULT 0,
  `idUsuarioAdmin` int(11) DEFAULT NULL,
  `estado` tinyint(1) DEFAULT 0,
  `fechaHoraAutorizacion` datetime DEFAULT NULL,
  `eliminar` tinyint(1) DEFAULT 0,
  `observacion` varchar(400) DEFAULT 'correcto',
  `recibidoLab` tinyint(1) DEFAULT 0,
  `idUsuarioLab` int(11) DEFAULT NULL,
  `rol` int(11) NOT NULL DEFAULT 0,
  `idIntervalo` int(11) DEFAULT NULL,
  `fechaRecLab` date DEFAULT NULL,
  `horaRecLab` time DEFAULT NULL,
  `fechaGenInforme` datetime DEFAULT NULL,
  `resultado` text DEFAULT NULL,
  `parcial` tinyint(4) NOT NULL DEFAULT 0,
  `fechaHoraPublicacionRes` datetime DEFAULT NULL,
  `publisher` tinyint(1) DEFAULT 0,
  `firma` varchar(100) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `idItemServicio` (`idItemServicio`),
  KEY `idSeguro` (`idSeguro`),
  KEY `idUsuarioSol` (`idUsuarioSol`),
  KEY `idPaciente` (`idPaciente`),
  KEY `idUsuarioAdmin` (`idUsuarioAdmin`),
  KEY `idUsuarioLab` (`idUsuarioLab`),
  KEY `idIntervalo` (`idIntervalo`),
  CONSTRAINT `solicitud_ibfk_1` FOREIGN KEY (`idItemServicio`) REFERENCES `itemservicio` (`id`),
  CONSTRAINT `solicitud_ibfk_2` FOREIGN KEY (`idSeguro`) REFERENCES `seguro` (`id`),
  CONSTRAINT `solicitud_ibfk_3` FOREIGN KEY (`idUsuarioSol`) REFERENCES `usuario` (`id`),
  CONSTRAINT `solicitud_ibfk_4` FOREIGN KEY (`idPaciente`) REFERENCES `paciente` (`id`),
  CONSTRAINT `solicitud_ibfk_5` FOREIGN KEY (`idUsuarioAdmin`) REFERENCES `usuario` (`id`),
  CONSTRAINT `solicitud_ibfk_6` FOREIGN KEY (`idUsuarioLab`) REFERENCES `usuario` (`id`),
  CONSTRAINT `solicitud_ibfk_7` FOREIGN KEY (`idIntervalo`) REFERENCES `intervalo` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1115 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

